import {Component} from "react";
import {Textbox} from "./Textbox";
import {Button} from "./Button";

export class AddCollectionModal extends Component
{
	constructor(props)
	{
		super(props);
		this.state = {
		};

		this.onAddCollectionSubmit = this.props.onAddCollectionSubmit.bind(this);
	}

	render()
	{
		return(
			<div className={"add-collection-modal"}>
				<h3>Collection Name (Word)</h3>
				<Textbox hint={"e.g. \"Horse\"..."} value={this.props.searchBoxValue} />
				<h3>Language</h3>
				<Textbox hint={"e.g. \"English (UK)\""} />
				<Button value={"Submit"} id={"add-collection-modal-submit"} onClick={this.props.onClick} />
			</div>
		);
	}
}
